class Solution:
    def checkIfPrerequisite(self, numCourses: int, prerequisites: list[list[int]], queries: list[list[int]]) -> list[bool]: 
        ans=[]
        connect = [[0 for i in range(100)] for j in range(100)]
        for prerequisite in prerequisites:
            connect[prerequisite[0]][prerequisite[1]]=1
        for i in range(100):
            for j in range(100):
                for k in range(100):
                    if connect[i][j] and connect[j][k]:
                        connect[i][k]=1
        for querie in queries:
            ans.append(connect[querie[0]][querie[1]])
        return ans

